        }

    ];

    letbuttonText = "Go Premium"
    return(
        <article className="dashboard">
            <Leftpane navigationListItems={navigationListItems}></Leftpane>
            <RightPane></RightPane>
            <div></div>
        </article>
    );
}

export default Dashboard;
